import "package:cardano_dart_types/cardano_dart_types.dart";
import "package:test/test.dart";

import "test_utils/fixtures.dart";

void main() async {
  debugAssertEnabled = true;
  group("CardanoTransaction", () {
    group("no change on re-encoding and tx body hash matches original", () {
      for (final testData in _TestCaseTx.values) {
        test(testData.name, () async {
          final reEncodedCbor = testData.cborHex.cborDecode().hexEncode();
          // mismatched cbor here means issue with cbor library
          expect(reEncodedCbor, testData.cborHex);

          final tx = CardanoTransaction.deserializeFromHex(testData.cborHex);
          final reEncoded = tx.serializeHexString();
          expect(tx.body.blake2bHash256.value, isNotNull);
          expect(tx.body.blake2bHash256, isA<Blake2bHash256Computed>());
          expect(tx.body.computeBlake2bHash256().hexEncode(), tx.body.blake2bHash256.value);
          expect(reEncoded, testData.cborHex);
        });
      }
    });

    group("preserves original CBOR key order", () {
      test("body with non-ascending key order preserves exact bytes", () {
        // This test uses a transaction where the body map keys are NOT in ascending order
        // The "midnight" tx has keys in order: 0, 13, 1, 2, 3, 7, 8, 11, 14, 16, 17, 18
        // (inputs, collateral, outputs, fee, ttl, auxDataHash, validityStart, scriptDataHash, requiredSigners, collateralReturn, totalCollateral, refInputs)
        final txHex = _TestCaseTx.midnight.cborHex;

        final tx = CardanoTransaction.deserializeFromHex(txHex);

        // Verify nonStandardKeyOrder was captured
        expect(tx.body.nonStandardKeyOrder, isNotNull);
        expect(tx.body.nonStandardKeyOrder, isNotEmpty);

        // Re-serialize and verify exact byte match
        final reEncoded = tx.serializeHexString();
        expect(reEncoded, txHex, reason: "CBOR key order must be preserved during re-serialization");
      });

      test("nonStandardKeyOrder is preserved through copyWith", () {
        final txHex = _TestCaseTx.midnight.cborHex;
        final tx = CardanoTransaction.deserializeFromHex(txHex);

        final nonStandardKeyOrder = tx.body.nonStandardKeyOrder;

        // Use copyWith to modify the body
        final modifiedTx = tx.copyWith.body(
          fee: tx.body.fee + BigInt.one,
        );

        // copyWith should preserve nonStandardKeyOrder
        expect(modifiedTx.body.nonStandardKeyOrder, equals(nonStandardKeyOrder));
      });

      test("manually created body has null nonStandardKeyOrder and uses ascending order", () {
        final body = CardanoTransactionBody.create(
          inputs: const CardanoTransactionInputs(data: [], cborTags: []),
          outputs: [],
          fee: BigInt.from(200000),
          ttl: BigInt.from(50000000),
          validityStartInterval: BigInt.from(40000000),
        );

        // Manually created body has no original key order
        expect(body.nonStandardKeyOrder, isNull);

        // Serialized output should have keys in ascending order: 0, 1, 2, 3, 8
        final serialized = body.serialize(forJson: false);
        final keys = serialized.keys.map((k) => (k as CborSmallInt).toInt()).toList();
        expect(
          keys,
          equals([0, 1, 2, 3, 8]),
          reason: "Manually created body should serialize with ascending key order",
        );
      });
    });

    test(
      "hash is constant",
      () {
        final tx = CardanoTransaction(
          overrideBodyMetadataHash: false,
          body: CardanoTransactionBody.create(
            networkId: null,
            referenceInputs: null,
            collateralReturn: null,
            requiredSigners: null,
            totalCollateral: null,
            scriptDataHash: null,
            collateral: null,
            inputs: const CardanoTransactionInputs(data: [], cborTags: []),
            outputs: [],
            fee: BigInt.one,
            ttl: null,
            validityStartInterval: null,
            metadataHash: null,
            mint: null,
            certs: null,
            withdrawals: null,
            votingProcedures: null,
            proposalProcedures: null,
            currentTreasuryValue: null,
            donation: null,
          ),
          witnessSet: emptyWitnessSet,
          isValidDi: true,
          auxiliaryData: CBORMetadata(value: const CborNull(tags: [22])),
        );

        expect(tx.hashCode, tx.hashCode);
      },
    );
  });
}

enum _TestCaseTx {
  midnight(
    "",
  ),
  ashiyapool(
    "",
  ),
  sentryFailure7(
    "",
  ),
  sentryFailure6(
    "",
  ),
  sentryFailure5(
    "",
  ),
  sentryFailure4(
    "",
  ),
  sentryFailure3(
    "",
  ),
  sentryFailure2(
    "",
  ),
  sentryFailure(
    "",
  ),
  unknown2(
    "",
  ),
  unknown1(
    "",
  ),
  wayup(
    "",
  ),
  wingriders(
    "",
  ),
  lucidEvolutionDelegateAbstainDrep(
    "",
  ),
  indigoTx(
    "",
  ),
  conwayVotingProcedure(
    "",
  ),
  conwayCerts(
    "",
  ),
  minswapOrderViaVespr(
    "",
  ),
  minswapOrder(
    "",
